import React from 'react';
import './app.css';

class App extends React.Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>
            SpaceX
          </h1>
        </header>

      </div>
    );
  }

}

// export default App;
ReactDOM.render(<App />, document.getElementById('root'));
